export const baseUrl = () => "http://localhost:3000/api";

export const fetcher = (url: string) =>
    fetch(url).then((res) => {
        setTimeout(() => res.json(), 1000);
    });

export interface IEmployee {
    id: string;
    name: string;
    surname: string;
    dateOfBirth: string;
    position: string;
    phoneNumber: string;
}
